const peakIndexInMountainArray = arr => {
  let [a, b] = [0, arr.length - 1];
  while (a < b) {
    const mida = Math.floor((a + b) / 2);
    const midb = Math.min(mida + 1, arr.length-1);
    if (arr[mida] > arr[midb]) {
      b = mida;
    } else {
      a = midb;
    }
  }
  return a;
};

